import LoginComponent from "./login";
import './login.css'

class Todo extends Component{
    constructor(props){
        super(props);
        this.generateTodos = this.generateTodos.bind(this);
    }

    render(){
        return(
            <div className="todo">
                <ul>
                    {this.generateTodos}
                </ul>
            </div>
        )
    }

    generateTodos(){
        let todos =
        [
            {id: 0, task: 'Eat'},
            {id: 1, task: 'Sleep'},
            {id: 2, task: 'Code'},
            {id: 2, task: 'Repeat'}
        ];

        let ret = todos.map((value,index) => <li key={index}> value </li>);
        console.log(ret);
        return ret;
    }
}

export default Todo;
